        <PayPalScriptProvider options={{ "client-id": "AfaebvtFXBG3t5j-v689WokLyo9nPyiB-_GtZG9YASPNrBEP2YeUnMJTtg7cqciebv4wKh6fVuPso3ar" }}>
            <PayPalButtons
            />
        </PayPalScriptProvider>
    );
}
